import "./App.css";
import Footer from "./Components/Footer/Footer";
import Header from "./Components/Header/Header";
import HomePage from "./screens/HomePage/HomePage";

const App = () => (
  <>
    <Header />
    <main style={{ minHeight: "93vh" }}></main>
    <HomePage />
    <Footer />
  </>
);

export default App;
